webpackJsonp([0x62ba3f1690c5],{4847:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Grandma Ruth",date:"14 Jan 2000",slug:"/2000-01-14-grandma-ruth/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/01/crh0114.jpg" height="449" width="400" border="0" alt="crh0114.jpg: " /></p>'},next:{fields:{title:"This child is supposed to be sleeping",date:"13 Jan 2000",slug:"/2000-01-13-this-child-is-supposed-to-be-sleeping/"}},previous:{fields:{title:"He looks like Mama too",date:"15 Jan 2000",slug:"/2000-01-15-he-looks-like-mama-too/"}}},{node:{fields:{title:"This child is supposed to be sleeping",date:"13 Jan 2000",slug:"/2000-01-13-this-child-is-supposed-to-be-sleeping/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/01/crh0113.jpg" height="300" width="400" border="0" alt="crh0113.jpg: " /></p>\n<p>After taking several days off after returning from the hospital, Mama is again writing for the <a href="http://www.mausnews.de">Maus Newsletter</a>, mostly in German. Today she started her childbirth report.</p>\n<p>It\'s hard to hold a baby and type at the computer simultaneously. Is there such a thing as a keyboard that can be used with one hand?</p>\n<p>Oma is here for her first visit of Christopher. We have a couple of pictures in the Week 3 album at <a href="http://albums.photopoint.com/j/AlbumList?u=185392">Photopoint</a></p>'},next:{fields:{title:"Our little hippo",date:"12 Jan 2000",slug:"/2000-01-12-our-little-hippo/"}},previous:{fields:{title:"Grandma Ruth",date:"14 Jan 2000",slug:"/2000-01-14-grandma-ruth/"}}},{node:{fields:{title:"Our little hippo",date:"12 Jan 2000",slug:"/2000-01-12-our-little-hippo/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/01/crh0112.jpg" height="400" width="300" border="0" alt="crh0112.jpg: " /></p>\n<p>We\'ve started calling Christopher our "Nilpferd" (Hippopatomus, but it sounds better in German) because of all the interesting sounds he makes. The grunts, snorts and wheezes sound mostly happy.</p>\n<p><a href="http://www.geocities.com/Yosemite/Trails/5542/Hippopotamus.html">A hippopotamus song</a>: <i>They ooze in the gooze without any shoes - They waide in the water \'til their lips turn blue - THAT\'S WHAT HIPPOS DO!</i></p>'},next:{fields:{title:"E-mail from home",date:"11 Jan 2000",slug:"/2000-01-11-e-mail-from-home/"}},previous:{fields:{title:"This child is supposed to be sleeping",date:"13 Jan 2000",slug:"/2000-01-13-this-child-is-supposed-to-be-sleeping/"}}}],pathPrefix:"",first:!1,last:!1,index:1090,pageCount:1101}}}});
